import React from 'react';

// Base64 encoded version of the wine image
const wineImageBase64 = "data:image/png;base64,";

/**
 * Wine glass visualization
 */
const WineImage = () => {
  return (
    <img 
      src={wineImageBase64}
      alt="Wine visualization"
      style={{
        width: '100%',
        height: '100%',
        objectFit: 'cover',
        borderRadius: '50%'
      }}
    />
  );
};

export default WineImage;